import React, { Component } from 'react';
import posed from "react-pose"
const Swipeable=posed.div({
    draggable:"x",
    
})




class Home extends Component {
    constructor(props) {
        super(props);
        this.state = { open: false }
    }
    
    render() { 
        return ( 
            <div>
                <div>
                    <Swipeable>Hello</Swipeable>
                </div>
            </div>
         );
    }
}
 
export default Home;
